import React from 'react';
import './styles.css';
import logo from './logo.svg'
import 'materialize-css';
import { Navbar, NavItem, Icon } from 'react-materialize' 

function App() {
  return (
    <div className="App">
      <Navbar 
        //className="Navbar"
        alignLinks="right"
        brand={<a className="brand-logo" href="#">Logo</a>}
        centerLogo
        id="mobile-nav"
        menuIcon={<Icon>menu</Icon>}
        options={{
          draggable: true,
          edge: 'left',
          inDuration: 250,
          onCloseEnd: null,
          onCloseStart: null,
          onOpenEnd: null,
          onOpenStart: null,
          outDuration: 200,
          preventScrolling: true
        }}
      >
        {/* <NavItem>
          Hello
        </NavItem>
        <NavItem>
          World!
        </NavItem> */}
      </Navbar>
    </div>
  );
}

export default App;
